<#
    .SYNOPSIS
    -A Powershell GUI that uses https://pwpush.com/ api to generate passwords.
    .NOTES
    -Credit for ConvertFrom-SecuredPassword and Publish-Password goes to https://github.com/pgarm/pwposh/blob/main/Public/Publish-Password.ps1
    -I added $Passphrase to the function so Passphrases could be used.
    -The only option not available so far is customization of passwords. It uses all valid alpabetic characters with these special characters. ('!', '@', '#', '%', '^', '&', '*')
#>

